const Discord = require("discord.js");
const fs = require('fs');
var embed = [];
var mainMessage;

//Setings
var timezone = "UTC"; // Default: UTC || Takes abbreviation timezones like EST, EDT, PST, etc.
var debug = false; // Default: false || Prints any errors that may have occured; will also print for await messages that ran out of time

try {
    new Date().toLocaleString("en-US", {
        timeZone: UTC
    })
} catch (e) {
    console.log(`${timezone} is an invalid timezone!\nResetting back to UTC.`);
    timezone = "UTC";
}

// Above checks validity of timezone, will reset to UTC if invalid.
// Please do not modify!

let embedTemplate = {
    color: 0xFFFF00,
    author: {
        name: client.user.username,
        icon_url: client.user.avatarURL
    },
    title: "Giveaway Setup",
    description: "This is a test embed to showcase what they look like and what they can do.",
    timestamp: new Date(),
}

var giveaway = {
    "itemGivingAway": "",
    "time": 0,
    "winner": 1,
    "finishUnix": 0,
    "channel": "",
    "server": msg.guild.id,
    "giveawayMessageID": "",
    "id": Math.floor(Math.random() * 999999) + 100000
}


if (msg.member.hasPermission('MANAGE_CHANNELS')) {
    embedTemplate["description"] = `Welcome to the giveaway promt.\n\nPlease first specify what embed title you would like for the giveaway.`;
    msg.channel.send({
            embed: embedTemplate
        })
        .then((message) => {
            mainMessage = message;
            askQuestion(`Welcome to the giveaway promt.\n\nPlease first specify what embed title you would like for the giveaway.`).then((response) => {
                embed[0] = response.content;
                askQuestion(`The embed title will be **${embed[0]}**\n\nIf this is correct please now enter a description!\nIf this is incorrect, please cancel the prompt with "cancel".`).then((response) => {
                    embed[1] = response.content
                    if (embed[1].toLowerCase() == "cancel") {
                        errorMessage('Prompt cancelled due to user cacellation. \nPlease re-execute the command to run through the prompt again!', "User responded with cancel thus cancelling the prompt");
                    } else {
                        embedTemplate["description"] = `The embed title will be **${embed[0]}** and the description is:\n\n${embed[1]}\n\nIf this is correct, please respond with "confirm" to send the embed!\nIf not, please respond with "cancel"`;
                        askQuestion(`The embed title will be **${embed[0]}** and the description is:\n\n${embed[1]}\n\nIf this is correct, please respond with "confirm" to send the embed!\nIf not, please respond with "cancel"`).then((response) => {
                            if (response.content.toLowerCase() == "confirm") {
                                askQuestion(`Now moving on to setting up the giveaway.\nPlease now specify what you are giving away!`).then((response) => {
                                    giveaway["itemGivingAway"] = response.content;
                                    askQuestion(`You are giving away "${response.content}" correct?\n\nIf so please respond now with the number of winners you would like to have.\nIf not, please respond with anything else.`).then((response) => {
                                        if (!isNaN(response.content)) {
                                            if (parseInt(response.content) > 0) {
                                                giveaway["winner"] = parseInt(response.content);
                                                askQuestion(`You are giving away "${giveaway["itemGivingAway"]}" to ${response.content} user(s).\n\nIf this is correct, please now respond with the amount of time alloted to the giveaway.\nEx. 1w | 1d | 1h | 1m`).then((response) => {
                                                    let tempTime = response.content.toLowerCase();
                                                    if (tempTime.includes("d") || tempTime.includes("h") || tempTime.includes("w") || tempTime.includes("m")) {
                                                        let timeUp;
                                                        let timeText;

                                                        if (tempTime.includes("d")) {
                                                            timeUp = "d";
                                                            timeText = "day(s)";
                                                        } else if (tempTime.includes("h")) {
                                                            timeUp = "h";
                                                            timeText = "hour(s)";
                                                        } else if (tempTime.includes("w")) {
                                                            timeUp = "w";
                                                            timeText = "week(s)";
                                                        } else if (tempTime.includes("m")) {
                                                            timeUp = "m";
                                                            timeText = "minute(s)";
                                                        }

                                                        tempTime = tempTime.split(timeUp);
                                                        if (!isNaN(tempTime[0])) {
                                                            tempTime[0] = parseInt(tempTime[0]);
                                                            switch (timeUp) {
                                                                case "d":
                                                                    giveaway["time"] = tempTime[0] * 86400;
                                                                    break;
                                                                case "h":
                                                                    giveaway["time"] = tempTime[0] * 3600;
                                                                    break;
                                                                case "w":
                                                                    giveaway["time"] = tempTime[0] * 604800;
                                                                    break;
                                                                case "m":
                                                                    giveaway["time"] = tempTime[0] * 60;
                                                                    break;
                                                            }
                                                            askQuestion(`You are giving away "${giveaway["itemGivingAway"]}" to ${giveaway["winner"]} user(s)\nThe winner will be drawn in ${tempTime[0]} ${timeText}\n\nIf this is correct, please now mention the channel the giveaway will be posted in.`).then((response) => {
                                                                if (response.mentions.channels.first() != null) {
                                                                    let giveawayChannel = response.mentions.channels.first();
                                                                    giveaway["channel"] = giveawayChannel.id;
                                                                    giveaway["finishUnix"] = Math.floor(Date.now() / 1000) + giveaway["time"];

                                                                    var giveawayEmbed = {
                                                                        color: 0x2E7F98,
                                                                        author: {
                                                                            name: embed[0],
                                                                            icon_url: client.user.avatarURL
                                                                        },
                                                                        description: embed[1],
                                                                        fields: [{
                                                                                name: '\u200b',
                                                                                value: '\u200b',
                                                                                inline: false,
                                                                            },
                                                                            {
                                                                                name: 'Item Giving Away',
                                                                                value: giveaway["itemGivingAway"],
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Created By',
                                                                                value: `${msg.author}`,
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Started At',
                                                                                value: new Date().toLocaleString("en-US", {
                                                                                    timeZone: timezone
                                                                                }),
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Ending At',
                                                                                value: new Date(giveaway["finishUnix"] * 1000).toLocaleString("en-US", {
                                                                                    timeZone: timezone
                                                                                }),
                                                                                inline: true,
                                                                            },
                                                                            {
                                                                                name: 'Giveaway Status',
                                                                                value: "Active/Ongoing",
                                                                                inline: true,
                                                                            },
                                                                        ],
                                                                        footer: {
                                                                            text: `The giveaway ends on ${new Date(giveaway["finishUnix"] * 1000).toLocaleString("en-US", { timeZone: timezone })} ${timezone.toUpperCase()} | ${giveaway["winner"]} Winner(s) | ID: ${giveaway["id"]}`
                                                                        }
                                                                    }

                                                                    giveawayChannel.send({
                                                                            embed: giveawayEmbed
                                                                        })
                                                                        .then(giveMsg => {
                                                                            giveMsg.react("üéâ");
                                                                            giveaway["giveawayMessageID"] = giveMsg.id;
                                                                            var giveawaySysData = Actions.giveawaySystem;

                                                                            if (!giveawaySysData.hasOwnProperty(msg.guild.id)) {
                                                                                giveawaySysData[msg.guild.id] = [];
                                                                            }

                                                                            giveawaySysData[msg.guild.id].push(giveaway);

                                                                            fs.writeFile("./data/giveawaySystem/giveawayData.json", JSON.stringify(giveawaySysData), function(err) {
                                                                                if (err) {
                                                                                    return console.log(err);
                                                                                }
                                                                            });
                                                                        });
                                                                    mainMessage.delete();
                                                                } else {
                                                                    errorMessage("You didn't enter a valid channel!\nEx. #example\n\nExiting setup; please re-run the command to restart the prompt.", "User did not mention a valid channel.");
                                                                }
                                                            });
                                                        } else {
                                                            errorMessage("You didn't enter a valid time format!\nEx. 1w | 1d | 1h | 1m\n\nExiting setup; please re-run the command to restart the prompt.", "User did not enter a valid time format like 1d, 1m, 1h");
                                                        }
                                                    } else {
                                                        errorMessage("You didn't enter a valid time format!\nEx. 1w | 1d | 1h | 1m\n\nExiting setup; please re-run the command to restart the prompt.", "User did not enter a valid time format like 1d, 1m, 1h");
                                                    }
                                                });

                                            } else {
                                                errorMessage("You didn't enter a valid number of winnners.\nExiting setup; please re-run the command to restart the prompt.", "User did not input a valid number of winners (non-positive number).");
                                            }
                                        } else {
                                            errorMessage("You didn't enter a valid number of winnners.\nExiting setup; please re-run the command to restart the prompt.", "User didn't enter a number for the number of winners.");
                                        }
                                    });
                                });
                            } else {
                                errorMessage('Prompt cancelled due to user responose (user did not respond with "confirm").\nPlease re-execute the command to run through the prompt again!', "User did not respond with confirm and thus the prompt has been cancelled.");
                            }
                        });
                    }
                });
            });
        })
} else {
    errorMessage("You do not have the `MANAGE ROLES` perimssion which is required to execute this command!", "User has no permission to execute the command.");
}

function errorMessage(error, errorCause = "none") {

    if (debug) {
        console.log(errorCause);
    }

    if (mainMessage != null) {
        mainMessage.delete();
    }

    let errorTemplate = {
        color: 0xFF0000,
        author: {
            name: client.user.username,
            icon_url: client.user.avatarURL
        },
        title: "Giveaway Setup",
        description: error,
        timestamp: new Date(),
    }

    msg.channel.send({
        embed: errorTemplate
    });
}

function askQuestion(question) {
    return new Promise(function(resolve, reject) {
        embedTemplate["description"] = question;
        mainMessage.edit({
            embed: embedTemplate
        });
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(function(collected) {
                msg.author.lastMessage.delete();
                resolve(collected.first());
            }).catch((error) => {
                errorMessage('Sorry, you didnt provide a valid response in time!\nPlease re-execute the command to go through the prompt again!', error, message);
            });
    })

}

// VersionCheck:2

if (globalVars("giveawayStartAlreadyRan") == null) {

    Actions.storeValue(true, 3, "giveawayStartAlreadyRan", cache);

    const fs = require('fs');
    const request = require('request');
    const Files = Actions.getDBM().Files;
    var checkUpdates = true;

    if (checkUpdates) {
        request('https://raw.githubusercontent.com/ItzPike/DBM-Rawdata-Releases/master/Giveaway%20Rewritten/versionCheck.json', function(error, response, body) {
            if (response.statusCode == 200) {
                var allVersions = JSON.parse(body);

                var commandVersions = {};
                var eventVersions = {};
                var commandKeys = [];
                var eventKeys = [];

                allVersions["commands"].forEach(commandVer => {
                    commandVersions[commandVer[0]] = commandVer[1];
                    commandKeys.push(commandVer[0]);
                });

                allVersions["events"].forEach(eventVer => {
                    eventVersions[eventVer[0]] = eventVer[1];
                    eventKeys.push(eventVer[0])
                })

                fs.readFile("./data/commands.json", async function(err, data) {
                    var data = JSON.parse(data);

                    var systemCommands = await data.filter(command => command != null && commandKeys.includes(command["_id"]));

                    for (i = 0; i < systemCommands.length; i++) {
                        var systemActionFind = await systemCommands[i]["actions"].filter(actionInfo => actionInfo.name = "Run Script" && actionInfo.code != null);

                        if (systemActionFind.length != 0) {
                            var versionCheckSplit = systemActionFind[0].code.split("VersionCheck:");
                            if (versionCheckSplit[1] != null && versionCheckSplit[1] != commandVersions[systemCommands[i]["_id"]] && !isNaN(versionCheckSplit[versionCheckSplit.length - 1])) {
                                console.log(`[Giveaway Rewritten] The command ${systemCommands[i]["name"]} needs an update!`)
                            }
                        }
                    }
                })

                fs.readFile("./data/events.json", async function(err, data) {
                    var data = JSON.parse(data);

                    var systemEvent = await data.filter(event => event != null && eventKeys.includes(event["_id"]));

                    for (i = 0; i < systemEvent.length; i++) {
                        var systemEventFind = await systemEvent[i]["actions"].filter(actionInfo => actionInfo.name = "Run Script" && actionInfo.code != null);

                        if (systemEventFind.length != 0) {
                            var versionCheckSplit = systemEventFind[0].code.split("VersionCheck:");
                            if (versionCheckSplit != null && versionCheckSplit[versionCheckSplit.length - 1] != eventVersions[systemEvent[i]["_id"]] && !isNaN(versionCheckSplit[versionCheckSplit.length - 1])) {
                                console.log(`[Giveaway Rewritten] The event ${systemEvent[i]["name"]} needs an update!`)
                            }
                        }
                    }
                })
            }
        });
    }

    if (globalVars("giveawaySystemMoved") == null) {
        Files.saveGlobalVariable("giveawaySystemMoved", true);

        if (!fs.existsSync(`./data/giveawaySystem`)) {
            fs.mkdirSync(`./data/giveawaySystem`);
        }

        ["giveawayData"].forEach(fileName => {
            if (fs.existsSync(`./data/${fileName}.json`)) {
                fs.renameSync( `./data/${fileName}.json`, `./data/giveawaySystem/${fileName}.json`);
            }
        });
    }

    if (!fs.existsSync('./data/giveawaySystem/giveawayData.json')) {
        fs.writeFile("./data/giveawaySystem/giveawayData.json", "{}", function(err) {
            if (err) {
                return console.log(err);
            }

            Actions.giveawaySystem = {};
        });
    } else {
        fs.readFile('./data/giveawaySystem/giveawayData.json', async function read(err, data) {
            if (err) {
                throw err;
            }

            Actions.giveawaySystem = JSON.parse(data);
        })
    }
}

